import React, {Component} from 'react';
import {
  Text,
  StyleSheet,
  View,
  ImageBackground,
  FlatList,
  Image,
  SafeAreaView,
  Platform,
  ScrollView,
} from 'react-native';
import styled from 'styled-components/native';
import ResponsiveImage from 'react-native-responsive-image';
import {
  heightPercentageToDP,
  widthPercentageToDP,
} from 'react-native-responsive-screen';
import {useNavigation, DrawerActions} from '@react-navigation/native';
import Header from '../../components/header';
import ThriveArticle from '../../components/thriveArticle';

import {
  menu,
  dummyimage,
  botomView,
  dots,
  image1,
  image2,
  image3,
  image4,
  image5,
  image6,
  image7,
  image8,
  addimage,
  image9,
  image10,
  image11,
  image12,
  image13,
  image14,
  image15,
  bottomadd,
  bottomCurve,
} from '../../common/images';

const GetAdvice = () => {
  const navigation = useNavigation();

  return (
    <View style={{flex: 1}}>
      <Image
        source={bottomCurve}
        style={{
          width: widthPercentageToDP(100),
          height: 200,
          position: 'absolute',
          bottom: -100,
        }}
        resizeMode="contain"></Image>
      <Header title="Welcome John" />
      <ScrollView
        alwaysBounceHorizontal={false}
        alwaysBounceVertical={false}
        bounces={false}
        style={{paddingTop: 20}}
        contentContainerStyle={{paddingBottom: 40}}>
        <View
          style={{
            flexDirection: 'row',
            flex: 1,
            justifyContent: 'flex-start',
            alignItems: 'flex-start',
          }}>
          <View style={{flex: 2}}>
            <View style={{flexDirection: 'column'}}>
              <RowimageFirst
                style={{flexDirection: 'row', justifyContent: 'space-between'}}>
                <ImageBackgroundView
                  source={image1}
                  style={{
                    height: widthPercentageToDP(66.67 / 4) - 10,
                    width: widthPercentageToDP(66.67 / 4) - 10,
                  }}
                  borderRadius={5}
                />
                <ImageBackgroundView
                  source={image2}
                  style={{
                    height: widthPercentageToDP(66.67 / 4) - 10,
                    width: widthPercentageToDP(66.67 / 4) - 10,
                  }}
                  borderRadius={5}
                />
                <ImageBackgroundView
                  source={image3}
                  style={{
                    height: widthPercentageToDP(66.67 / 4) - 10,
                    width: widthPercentageToDP(66.67 / 4) - 10,
                  }}
                  borderRadius={5}
                />
                <ImageBackgroundView
                  source={image4}
                  style={{
                    height: widthPercentageToDP(66.67 / 4) - 10,
                    width: widthPercentageToDP(66.67 / 4) - 10,
                  }}
                  borderRadius={5}
                />
              </RowimageFirst>
              <RowimageFirst
                style={{
                  flexDirection: 'row',
                  justifyContent: 'space-between',
                  marginTop: 6,
